import Header from '../commons/Header/Header'
import Footer from '../commons/Footer/Footer'

function People ({ data }) {
  return (
    <>
      <h1>People</h1>
      {data.map((people, i) => {
        return (
          <div key={i}>
            <p>Name: {people.name} </p>
            <p>Height: {people.height} </p>
            <p>Mass: {people.mass} </p>
          </div>
        );
      })}
      <Header />
      <Footer />
    </>
  );
}

export default People;
